style.css:
@-moz-document domain(newsletter.mollywhite.net) {
    body {
      background: #000 !important;
      color: #fff !important;
    }

    .single-post-container {
      background: #222 !important;
    }

    .use-theme-bg .post .page-title, .use-theme-bg .post .page-title a, .use-theme-bg .post .subtitle, .use-theme-bg .post h1, .use-theme-bg .post h1 a, .use-theme-bg .post h1.title a, .use-theme-bg .post h2, .use-theme-bg .post h2 a, .use-theme-bg .post h3, .use-theme-bg .post h3 a, .use-theme-bg .post h4, .use-theme-bg .post h4 a, .use-theme-bg .post h5, .use-theme-bg .post h5 a, .use-theme-bg .post h6, .use-theme-bg .post h6 a, .use-theme-bg .post p, .use-theme-bg .post p a {
      color: #eeeeee;
  }
}
